const addCourseApi = async () => {
  try {
    const result = await axios.post(
      `${process.env.REACT_APP_API_URL}/admin/create`
    );
    if (result) {
      return result;
    }
  } catch (err) {
    return { data: err.response.data };
  }
};
export { addCourseApi };
